script: |
  super -f text -I q6128.spq | sort > q6128.out

inputs:
  - name: q6128.spq
    data: |
      SELECT ALL col0 FROM tab1 (FORMAT parquet) WHERE + col0 NOT IN ( - 19, ( + col1 ) * - + col2 * - 12 + + col2 - - col0 * col1 * - 51 * - col1 );
  - name: tab1

outputs:
  - name: q6128.out
    data: |
      51
      85
      91
